import { postPublications } from "../../api/publications";
import { POST_BIKE } from "./type";

export const postBike = (body, callback) => async (dispatch) => {
  try {
    const { data } = await postPublications(body);
    dispatch({ type: POST_BIKE, terms: data.accepted });
    callback(data, null);
  } catch (error) {
    callback(null, error);
  }
};
